                <Text style={{padding:10,fontWeigh:'700',color:'white'}}>Hoodie</Text>
                <MaterialCommunityIcons name="cart" color={white} size={16} />
        )
            </View>
            <Text>single</Text>
        </View>
    )
}

export default SingleScreen
